

jQuery(document).on('change', 'input[name="flexRadioDefault"]', function() {
  $('.date').mask('11/11/1111');
  $('.time').mask('00:00:00');
  $('.date_time').mask('00/00/0000 00:00:00');
  $('.cep').mask('00000-000');
  $('.phone').mask('0000-0000');
  $('.phone_with_ddd').mask('(00) 0 0000-0000');
  $('.phone_us').mask('(000) 000-0000');
  $('.mixed').mask('AAA 000-S0S');
  $('.cpf').mask('000.000.000-00', {reverse: true});
  $('.money').mask('000.000.000.000.000,00', {reverse: true});
  $('.cnpj').mask('00.000.000/0000-00', {reverse: true});
  $('.serial').mask('AA0000000');
  var selecao = jQuery('input[name="flexRadioDefault"]:checked').val();
  
  if (typeof selecao === "undefined") {
      esconderFormularios();
  } else if (selecao === 'cpf') {
      jQuery('#cpf_form').show();
      jQuery('#form_cnpj').hide();
  } else if (selecao === 'cnpj') {
      jQuery('#cpf_form').hide();
      jQuery('#form_cnpj').show();
  }

  function esconderFormularios() {
    jQuery('#cpf_form').hide();
    jQuery('#form_cnpj').hide();
}
});

